import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";

import pic1 from "../Images/right.webp";
import pic2 from "../Images/first.webp";
import pic3 from "../Images/second.webp";
import pic4 from "../Images/third.webp";
import pic5 from "../Images/forth.webp";
import pic6 from "../Images/fifth.webp";
import pic7 from "../Images/sixth.webp";
import pic8 from "../Images/one.webp";
import pic9 from "../Images/two.png";
import pic10 from "../Images/three.jpeg";
import pic11 from "../Images/four.webp";
import pic12 from "../Images/five.jpg";

const services = [
  { img: "https://cdn-icons-png.flaticon.com/512/2867/2867281.png", text: "Women's Salon & Spa" },
  { img: "https://cdn-icons-png.flaticon.com/512/2867/2867316.png", text: "Men's Salon & Massage" },
  { img: "https://cdn-icons-png.flaticon.com/512/2867/2867294.png", text: "AC & Appliance Repair" },
  { img: "https://cdn-icons-png.flaticon.com/512/2867/2867311.png", text: "Cleaning" },
  { img: "https://cdn-icons-png.flaticon.com/512/2867/2867302.png", text: "Electrician & Plumber" },
  { img: "https://cdn-icons-png.flaticon.com/512/2867/2867324.png", text: "Water Purifier" },
];

const carouselImages1 = [pic2, pic3, pic4, pic5, pic6, pic7];
const carouselImages2 = [pic8, pic9, pic10, pic11, pic12];

const Home = () => {
  return (
    <div className="container mt-5">
      {/* Services Section */}
      <div className="row align-items-center">
        <div className="col-lg-6 text-center">
          <h2 className="mb-4">Home Services at Your Doorstep</h2>
          <div className="p-4 rounded shadow bg-light" style={{ maxWidth: "500px" }}>
            <h5>What are you looking for?</h5>
            <div className="row g-3 mt-3">
              {services.map((service, index) => (
                <div key={index} className="col-4 text-center">
                  <div className="p-3 bg-white rounded shadow-sm">
                    <img src={service.img} alt={service.text} width="40" height="40" />
                    <p className="mt-2" style={{ fontSize: "0.85rem" }}>{service.text}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
        <div className="col-lg-6">
          <img src={pic1} alt="Home Services" className="img-fluid rounded w-100" style={{ maxHeight: "400px", objectFit: "cover" }} />
        </div>
      </div>

      {/* Rating Section */}
      <div className="d-flex justify-content-center gap-5 mt-5">
        <div className="text-center">
          <h3>⭐ 4.8</h3>
          <p className="text-muted">Service Rating</p>
        </div>
        <div className="text-center">
          <h3>👥 12M+</h3>
          <p className="text-muted">Customers Globally</p>
        </div>
      </div>

      {/* Carousel Sections */}
      <Carousel images={carouselImages1} title="Popular Services" />
      <Carousel images={carouselImages2} title="New and Noteworthy" />
    </div>
  );
};

const Carousel = ({ images, title }) => {
  return (
    <div className="mt-5">
      <h2 className="mb-4 text-center">{title}</h2>
      <div id={`carousel-${title.replace(/\s/g, "")}`} className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-inner">
          {images.map((image, index) => (
            <div key={index} className={`carousel-item ${index === 0 ? "active" : ""}`}>
              <div className="row justify-content-center">
                <div className="col-lg-4">
                  <img src={image} className="img-fluid rounded w-100" alt={`Slide ${index + 1}`} />
                </div>
              </div>
            </div>
          ))}
        </div>
        <button className="carousel-control-prev" type="button" data-bs-target={`#carousel-${title.replace(/\s/g, "")}`} data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target={`#carousel-${title.replace(/\s/g, "")}`} data-bs-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
        </button>
      </div>
    </div>
  );
};

export default Home;
